import './boxInfos.scss'


export default function Caixa(props){
    return(
        <main>
            <div class="box">
	    <span class="top"></span>
    <span class="right"></span>
    <span class="bottom"></span>
    <span class="left"></span>
</div>
        </main>
    )
}
